//apps.apple.com/us/app/play-worldly/id6743803487"},{Title:"RBM Sounds","Embed link":"http://rbmsounds.com/",Website:"http://rbmsounds.com/",Screenshot:"../assets/RBMSounds.avif",useScreenshot:!0,Technologies:["Velo","Javascript","UI/UX","Adobe CC","Figma"],Description:"RBM Sounds is a fully functional e-commerce website built using the Velo by Wix framework, designed to sell my digital products, including music production resources tailored for producers. The site integrates seamless payment processing, user-friendly navigation, and responsive design to provide an effortless shopping experience.",GithubRepoURL:"",Presentation:"",AppStore:""},{Title:"Riff Rabbit","Embed link":"",Website:"",Screenshot:"../assets/RiffRabbit.avif",useScreenshot:!1,Technologies:["React","SQL","Postgres","Express","Javascript","HTML","Tailwind","Framer","UI/UX","Adobe CC","Figma"],Description:"Riff Rabbit is a full-stack multiplayer interval training game designed for musicians to sharpen their ear training skills in a fun, interactive way. Built with React for the frontend and Node.js with Express for the backend, the game features a structured interval training system and includes user authentication with OAuth. The backend is powered by PostgreSQL, with TablePlus for database management. Custom graphics and user interface designs were created using Figma and Adobe Illustrator.",GithubRepoURL:"",Presentation:"https://docs.google.com/presentation/d/e/2PACX-1vRn_xtcRU7Qs6_fx6J0JswMwCprxiKS5Vn0UQ9HtOCNGa-n-bokIq5hBjUEwyW7n7BmUElvKyoKK8nf/pubembed?start=true&loop=true&delayms=5000",AppStore:""},{Title:"Weather Now","Embed link":"",Website:"",Screenshot:"../assets/WeatherNow.avif",useScreenshot:!1,Technologies:["React","CSS","Javascript","HTML","UI/UX","Adobe CC","Figma"],Description:"Weather Now is a team project built with React, HTML, and CSS, designed to provide users with real-time weather updates and sunset information. The app integrates API calls to fetch accurate weather data and sunset times based on user location. The clean and intuitive frontend design ensures a seamless user experience, making it easy to check current conditions and plan accordingly.",GithubRepoURL:"https://github.com/Weather-Now/WeatherNow",Presentation:"https://docs.google.com/presentation/d/e/2PACX-1vRvRQZGhNDsgXNq7WJiqINuc4Q1LvDxe7-eKi3HoiWmpfhbryeBrA7JYJcvHH1n8EtoW8ewEAQnZHqz/pubembed?start=true&loop=true&delayms=3000",AppStore:""},{Title:"Shabbat Zman","Embed link":"https://shabbatzman.com/",Website:"https://shabbatzman.com/",Screenshot:"../assets/ShabbatZman.png",useScreenshot:!0,Technologies:["React","React Native","CSS","Javascript","HTML","UI/UX","Adobe CC","Figma"],Description:"Shabbatzman.com is a React-based web app designed to simplify Jewish practice by providing accurate zmanim (prayer times) based on the user's location. The app integrates the Geolocation API to automate location detection, making it easier to observe halachic times without manual input. Key components include a responsive design built with React and modern CSS for accessibility across devices. The app connects to a reliable zmanim API to calculate prayer times according to various halachic opinions, ensuring accuracy and inclusivity.",GithubRepoURL:"https://github.com/Rafibarides/shabbat-zman-mobile",Presentation:"",AppStore:"https://apps.apple.com/us/app/shabbat-zman/id6741112947"},{Title:"Gelt Capital","Embed link":"http://geltcapitalusa.com/",Website:"http://geltcapitalusa.com/",Screenshot:"../assets/GeltCapital.avif",useScreenshot:!0,Technologies:["React","CSS","Javascript","HTML","UI/UX","Adobe CC","Figma"],Description:"Developed with React, this website is for Gelt Capital, a leading fintech firm in the funding space, delivering seamless, high-performance tools for investors and businesses alike. The site blends modern UI design with robust infrastructure to streamline capital management, optimize deal flow, and provide real-time insights—all while maintaining enterprise-grade security and scalability",GithubRepoURL:"https://github.com/capital-firm-rbm/gelt-equity",Presentation:"",AppStore:""},{Title:"Communitree","Embed link":"",Website:"",Screenshot:"../assets/communitree.png",useScreenshot:!1,Technologies:["React","CSS","Javascript","Postgres","SQL","Express","HTML","UI/UX","Adobe CC","Figma"],Description:"Communitree is a platform working to foster real-life interactions, building community through sustainability. We began by designing an Entity-Relationship Diagram (ERD) and creating PostgreSQL tables to support the full stack application. A React-based community forum was built to efficiently collect and store user and post data in SQL. The project involved interacting with third-party APIs and libraries to display location data, ensure accessibility, and apply dynamic styling. Consistent visual elements and designs were crafted using Figma, Adobe Creative Suite, and Linearity. Additionally, a Content Delivery Network (CDN) was implemented with Cloudflare to enhance site performance and reduce load times.",GithubRepoURL:"https://github.com/Green-Guild/communiTree",Presentation:"https://docs.google.com/presentation/d/e/2PACX-1vSTGV5VvIgVwZQDzd-1TXW7mZcpT9H95G-Itlj6QiqTk-CpeRSuD-pk52jk05CSNU7PlpgmKjCrKN7q/pubembed?start=true&loop=true&delayms=3000",AppStore:""}],$T=({projectTitle:n,onClose:a})=>{const[r,o]=D.useState(null);if(D.useEffect(()=>{const m=Bo.find(g=>g.Title.toLowerCase()===decodeURIComponent(n).toLowerCase());return o(m),document.body.style.overflow="hidden",()=>{document.body.style.overflow="auto"}},[n]),!r)return null;const u=m=>{const g=m.split(" ");if(g.length<=1)return x.jsx("span",{style:{fontFamily:"'Poppins', sans-serif"},children:m});const b=g.pop(),S=g.join(" ");return x.jsxs(x.Fragment,{children:[x.jsxs("span",{style:{fontFamily:"'Poppins', sans-serif"},children:[S," "]}),x.jsx("span",{style:{fontFamily:"'Caveat', cursive",fontWeight:600},children:b})]})},f=m=>{if(!m)return null;const g=/^.*(youtu.be\/|v\/|u\/\w\/|e